import React from 'react';
import '../css/Footer.css'
function Footer() {
  const footerStyle = {
    backgroundColor: '#001f3f', // Azul oscuro
    color: '#32CD32', // Verde
    textAlign: 'center',
    padding: '10px',
    position: 'fixed',
    width: '100%',
    bottom: '0'
  };

  return (
    <footer style={footerStyle}>
      <p>© 2024 Derechos Reservados. Empresa de Construcción y Domótica.</p>
    </footer>
  );
}

export default Footer;
